import React from "react";
import logo from "../asset/logo.svg";
import "../styles/Nav.css";

const Nav = () => {
  return (
    <div className="nav">
      <div className="logo">
        <img src={logo}></img>
      </div>
      <span className="nav-link">COLLECTION</span>
      <span className="nav-link">CONTACT</span>
    </div>
  );
};
export default Nav;
